import { Provider } from 'react-redux';
import store from 'store/store';
import { WebSocketProvider } from 'store/machine/client';
import Tile from 'components/Tile';

function App() {
  return (
    <Provider store={store}>
      <WebSocketProvider>
        <Tile />
      </WebSocketProvider>
    </Provider>
  );
}

export default App;
